  return (
    <div className="d-flex flex-column w-100" >
      <div className="Quizheader mb-2">Question # 1:</div>
      <div className="QuizQuestion">Who was quaid-e-azam?</div>
      <div className="QuizContent">
        <div className="centered">
          <Button className="quizbtn">Previous</Button>
          <Button className="quizbtn w-25">{"Next"}</Button>
        </div>
      </div>
    </div>
  );
}

